import React from 'react';
// import Navbar from './PhotoComponents/Navbar';
import './App.css';
// import Home from './components/pages/Home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
// import Services from './components/pages/Services';
import Products from '../src/PhotoComponents/pages/Products';
// import SignUp from './components/pages/SignUp';
// import PhotographyPage from './PhotoComponents/pages/PhotographyPage';
// import WebDevPage from './WebDevComponents/Pages/WebDevPage';
// import LandingPage from './WebDevComponents/Pages/LandingPage';

function App() {
  return (
    <>
      <Router>
        {/* <Navbar /> */}
        <Routes>
          <Route path='/' exact component={ Products } />
          {/* <Route path='/Photography' component={ PhotographyPage } /> */}
          {/* <Route path='/WebDev' component={ WebDevPage } /> */}
          {/* <Route path='/sign-up' component={SignUp} /> */}
        </Routes>
      </Router>
    </>
  );
}

export default App;
